import React, { Component } from "react";



function App () {
    return (
        <Router >
            <div className="App">
                <RenderLinks />
                
                <Switch >
                    <Route path="/" exact component={Home}/>
                    <Route path="/blog" exact component={Blog}/>
                    <Route path="/about" exact component={About}/>

                </Switch>
            </div>
        </Router>
    )
    
}
export default App;
